import React from 'react';
import { useState } from 'react';

const lists = [
    {
        "id": 1,
        "name": "Vi"
    },
    {
        "id": 2,
        "name": "Vinh"
    },
    {
        "id": 3,
        "name": "Thục Vi"
    }
]



function Todo(props) {
    const [checked, setChecked] = useState();

    const handleCheckedChange = () => {
        setChecked(checked)
    }

    return (
        <div>
            {
                lists.map(infor => (
                    <div key={infor.id} >
                        <input
                            type="checkbox"
                        >{infor.name}</input>
                    </div>
                ))
            }
        </div >
    );
}

export default Todo;
